import React from 'react'
import data from './users.json'
import UserItem from './UserItem.js';

const UserList = () => {

   const test = () => {
      let age = 0;
      let count = 0;
      for (let i = 0; i < data.length; i++) {
         if (i.role === 'admin') {
            count++;
         }
         return count;
      }
      data.map((item) => {
         return (
            (item.role === 'admin'

               ? age += (item.age) / count
               : ''
            )
         )
      })
      console.log(age)

   }
   return (<div >
      {data.map((users) => {
         return (
            (users.role === 'user' ?
               <UserItem name={users.name} />
               : ''
            )
         )
      })}
      <button onClick={test}>test</button>
   </div>)
}

export default UserList
